DROP VIEW IF EXISTS `t3`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `t3` AS select `t1`.`no` AS `no`,`t1`.`name` AS `name`,`t1`.`code` AS `code`,`t1`.`py` AS `py`,`t1`.`sn` AS `sn`,`t1`.`sn2` AS `sn2`,`x`.`编号` AS `编号`,`x`.`铁路局` AS `铁路局`,`x`.`站名` AS `站名`,`x`.`描述` AS `描述`,`x`.`省份` AS `省份`,`x`.`城市` AS `城市`,`x`.`车站地址` AS `车站地址`,`x`.`旅客乘降` AS `旅客乘降`,`x`.`行李` AS `行李`,`x`.`包裹` AS `包裹` from (`t1` left join `x` on(((`t1`.`name` = `x`.`站名`) or (concat(`t1`.`name`,'站') = `x`.`站名`)))) ;
