INSERT INTO `article` VALUES ('3', '8', '1#8', '1', 'upload/2016/07/19/07c4c858a1564bd4b8b4380d1fdd0941.jpg', 'NoSQL 简介', 'nosql介绍', '<h1 style=\"border: 0px; margin: 0px 0px 10px; padding: 0px; font-size: 2.1em; font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 2em;\">NoSQL(NoSQL = Not Only SQL )，意即&quot;不仅仅是SQL&quot;。</span></h1><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 14px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\">在现代的计算系统上每天网络上都会产生庞大的数据量。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 14px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\">这些数据有很大一部分是由关系数据库管理系统（RDMBSs）来处理。 1970年 E.F.Codd&#39;s提出的关系模型的论文 &quot;A relational model of data for large shared data banks&quot;，这使得数据建模和应用程序编程更加简单。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 14px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\">通过应用实践证明，关系模型是非常适合于客户服务器编程，远远超出预期的利益，今天它是结构化数据存储在网络和商务应用的主导技术。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 14px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\">NoSQL 是一项全新的数据库革命性运动，早期就有人提出，发展至2009年趋势越发高涨。NoSQL的拥护者们提倡运用非关系型的数据存储，相对于铺天盖地的关系型数据库运用，这一概念无疑是一种全新的思维的注入。</p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">关系型数据库遵循ACID规则</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">事务在英文中是transaction，和现实世界中的交易很类似，它有如下四个特性：</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">1、A (Atomicity) 原子性</strong><br/>原子性很容易理解，也就是说事务里的所有操作要么全部做完，要么都不做，事务成功的条件是事务里的所有操作都成功，只要有一个操作失败，整个事务就失败，需要回滚。<br/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">比如银行转账，从A账户转100元至B账户，分为两个步骤：1）从A账户取100元；2）存入100元至B账户。这两步要么一起完成，要么一起不完成，如果只完成第一步，第二步失败，钱会莫名其妙少了100元。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">2、C (Consistency) 一致性</strong><br/>一致性也比较容易理解，也就是说数据库要一直处于一致的状态，事务的运行不会改变数据库原本的一致性约束。<br/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">例如现有完整性约束a+b=10，如果一个事务改变了a，那么必须得改变b，使得事务结束后依然满足a+b=10，否则事务失败。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">3、I (Isolation) 独立性</strong><br/>所谓的独立性是指并发的事务之间不会互相影响，如果一个事务要访问的数据正在被另外一个事务修改，只要另外一个事务未提交，它所访问的数据就不受未提交事务的影响。<br/>比如现有有个交易是从A账户转100元至B账户，在这个交易还未完成的情况下，如果此时B查询自己的账户，是看不到新增加的100元的。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">4、D (Durability) 持久性</strong><br/>持久性是指一旦事务提交后，它所做的修改将会永久的保存在数据库上，即使出现宕机也不会丢失。</p><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">分布式系统</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">分布式系统（distributed system）由多台计算机和通信的软件组件通过计算机网络连接（本地网络或广域网）组成。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">分布式系统是建立在网络之上的软件系统。正是因为软件的特性，所以分布式系统具有高度的内聚性和透明性。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">因此，网络和分布式系统之间的区别更多的在于高层软件（特别是操作系统），而不是硬件。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">分布式系统可以应用在在不同的平台上如：Pc、工作站、局域网和广域网上等。</p><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">分布式计算的优点</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">可靠性（容错） ：</strong><br/>分布式计算系统中的一个重要的优点是可靠性。一台服务器的系统崩溃并不影响到其余的服务器。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">可扩展性：</strong><br/>在分布式计算系统可以根据需要增加更多的机器。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">资源共享：</strong><br/>共享数据是必不可少的应用，如银行，预订系统。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">灵活性：</strong><br/>由于该系统是非常灵活的，它很容易安装，实施和调试新的服务。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">更快的速度：</strong><br/>分布式计算系统可以有多台计算机的计算能力，使得它比其他系统有更快的处理速度。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">开放系统：</strong><br/>由于它是开放的系统，本地或者远程都可以访问到该服务。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">更高的性能：</strong><br/>相较于集中式计算机网络集群可以提供更高的性能（及更好的性价比）。</p><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">分布式计算的缺点</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">故障排除： ：</strong><br/>故障排除和诊断问题。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">软件：&nbsp;</strong><br/>更少的软件支持是分布式计算系统的主要缺点。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">网络：</strong><br/>网络基础设施的问题，包括：传输问题，高负载，信息丢失等。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">安全性：&nbsp;</strong><br/>开发系统的特性让分布式计算系统存在着数据的安全性和共享的风险等问题。</p><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">什么是NoSQL?</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">NoSQL，指的是非关系型的数据库。NoSQL有时也称作Not Only SQL的缩写，是对不同于传统的关系型数据库的数据库管理系统的统称。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">NoSQL用于超大规模数据的存储。（例如谷歌或Facebook每天为他们的用户收集万亿比特的数据）。这些类型的数据存储不需要固定的模式，无需多余操作就可以横向扩展。</p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">为什么使用NoSQL ?</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">今天我们可以通过第三方平台（如：Google,Facebook等）可以很容易的访问和抓取数据。用户的个人信息，社交网络，地理位置，用户生成的数据和用户操作日志已经成倍的增加。我们如果要对这些用户数据进行挖掘，那SQL数据库已经不适合这些应用了, NoSQL数据库的发展也却能很好的处理这些大的数据。</p><p><img src=\"/upload/image/20160719/1468896766220029083.png\" alt=\"web-data-image\" width=\"551\" height=\"371\" class=\"alignnone size-full wp-image-3519\" srcset=\"http://www.runoob.com/wp-content/uploads/2013/10/web-data-image.png 551w, http://www.runoob.com/wp-content/uploads/2013/10/web-data-image-300x201.png 300w\" sizes=\"(max-width: 551px) 100vw, 551px\" style=\"border: 0px; margin: 0px; padding: 0px; max-width: 100%; height: auto; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">实例</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">社会化关系网:</p><p>Each record: UserID1, UserID2&nbsp;<br/>Separate records: UserID, first_name,last_name, age, gender,...&nbsp;<br/>Task: Find all friends of friends of friends of ... friends of a given user.</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">Wikipedia 页面 :</p><p>Large collection of documents&nbsp;<br/>Combination of structured and unstructured data&nbsp;<br/>Task: Retrieve all pages regarding athletics of Summer Olympic before 1950.</p><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">RDBMS vs NoSQL</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">RDBMS&nbsp;</strong><br/>- 高度组织化结构化数据&nbsp;<br/>- 结构化查询语言（SQL） (SQL)&nbsp;<br/>- 数据和关系都存储在单独的表中。&nbsp;<br/>- 数据操纵语言，数据定义语言&nbsp;<br/>- 严格的一致性<br/>- 基础事务</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">NoSQL&nbsp;</strong><br/>- 代表着不仅仅是SQL<br/>- 没有声明性查询语言<br/>- 没有预定义的模式<br/>-键 - 值对存储，列存储，文档存储，图形数据库<br/>- 最终一致性，而非ACID属性<br/>- 非结构化和不可预知的数据<br/>- CAP定理&nbsp;<br/>- 高性能，高可用性和可伸缩性</p><p><img src=\"/upload/image/20160719/1468896766455001987.png\" alt=\"bigdata\" width=\"600\" height=\"326\" class=\"alignnone size-full wp-image-3520\" srcset=\"http://www.runoob.com/wp-content/uploads/2013/10/bigdata.png 600w, http://www.runoob.com/wp-content/uploads/2013/10/bigdata-300x163.png 300w\" sizes=\"(max-width: 600px) 100vw, 600px\" style=\"border: 0px; margin: 0px; padding: 0px; max-width: 100%; height: auto; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">NoSQL 简史</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">NoSQL一词最早出现于1998年，是Carlo Strozzi开发的一个轻量、开源、不提供SQL功能的关系数据库。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">2009年，Last.fm的Johan Oskarsson发起了一次关于分布式开源数据库的讨论[2]，来自Rackspace的Eric Evans再次提出了NoSQL的概念，这时的NoSQL主要指非关系型、分布式、不提供ACID的数据库设计模式。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">2009年在亚特兰大举行的&quot;no:sql(east)&quot;讨论会是一个里程碑，其口号是&quot;select fun, profit from real_world where relational=false;&quot;。因此，对NoSQL最普遍的解释是&quot;非关联型的&quot;，强调Key-Value Stores和文档数据库的优点，而不是单纯的反对RDBMS。</p><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">CAP定理（CAP theorem）</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">在计算机科学中, CAP定理（CAP theorem）, 又被称作 布鲁尔定理（Brewer&#39;s theorem）, 它指出对于一个分布式计算系统来说，不可能同时满足以下三点:</p><ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p><strong style=\"border: 0px; margin: 0px; padding: 0px;\">一致性(Consistency)</strong>&nbsp;(所有节点在同一时间具有相同的数据)</p></li><li><p><strong style=\"border: 0px; margin: 0px; padding: 0px;\">可用性(Availability)</strong>&nbsp;(保证每个请求不管成功或者失败都有响应)</p></li><li><p><strong style=\"border: 0px; margin: 0px; padding: 0px;\">分隔容忍(Partition tolerance)</strong>&nbsp;(系统中任意信息的丢失或失败不会影响系统的继续运作)</p></li></ul><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">CAP理论的核心是：一个分布式系统不可能同时很好的满足一致性，可用性和分区容错性这三个需求，最多只能同时较好的满足两个。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">因此，根据 CAP 原理将 NoSQL 数据库分成了满足 CA 原则、满足 CP 原则和满足 AP 原则三 大类：</p><ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p>CA - 单点集群，满足一致性，可用性的系统，通常在可扩展性上不太强大。</p></li><li><p>CP - 满足一致性，分区容忍必的系统，通常性能不是特别高。</p></li><li><p>AP - 满足可用性，分区容忍性的系统，通常可能对一致性要求低一些。</p></li></ul><p><img src=\"/upload/image/20160719/1468896766481067334.png\" alt=\"cap-theoram-image\" width=\"671\" height=\"578\" class=\"alignnone size-full wp-image-3521\" srcset=\"http://www.runoob.com/wp-content/uploads/2013/10/cap-theoram-image.png 671w, http://www.runoob.com/wp-content/uploads/2013/10/cap-theoram-image-300x258.png 300w\" sizes=\"(max-width: 671px) 100vw, 671px\" style=\"border: 0px; margin: 0px; padding: 0px; max-width: 100%; height: auto; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">NoSQL的优点/缺点</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">优点:</p><ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p>- 高可扩展性</p></li><li><p>- 分布式计算</p></li><li><p>- 低成本</p></li><li><p>- 架构的灵活性，半结构化数据</p></li><li><p>- 没有复杂的关系</p></li></ul><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">缺点:</p><ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p>- 没有标准化</p></li><li><p>- 有限的查询功能（到目前为止）</p></li><li><p>- 最终一致是不直观的程序</p></li></ul><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">BASE</h2><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">BASE：Basically Available, Soft-state, Eventually Consistent。 由 Eric Brewer 定义。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">CAP理论的核心是：一个分布式系统不可能同时很好的满足一致性，可用性和分区容错性这三个需求，最多只能同时较好的满足两个。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 2em; font-size: 12px; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">BASE是NoSQL数据库通常对可用性及一致性的弱要求原则:</p><ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p>Basically Availble --基本可用</p></li><li><p>Soft-state --软状态/柔性事务。 &quot;Soft state&quot; 可以理解为&quot;无连接&quot;的, 而 &quot;Hard state&quot; 是&quot;面向连接&quot;的</p></li><li><p>Eventual Consistency --最终一致性 最终一致性， 也是是 ACID 的最终目的。</p></li></ul><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">ACID vs BASE</h2><table class=\"reference\" width=\"729\"><tbody style=\"border: 0px; margin: 0px; padding: 0px;\"><tr style=\"border: 0px; margin: 0px; padding: 0px; background-color: rgb(246, 244, 240);\" class=\"firstRow\"><th style=\"border-color: rgb(85, 85, 85); margin: 0px; padding: 3px; color: rgb(255, 255, 255); vertical-align: top; background-color: rgb(85, 85, 85);\">ACID</th><th style=\"border-color: rgb(85, 85, 85); margin: 0px; padding: 3px; color: rgb(255, 255, 255); vertical-align: top; background-color: rgb(85, 85, 85);\">BASE</th></tr><tr style=\"border: 0px; margin: 0px; padding: 0px;\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">原子性(<strong style=\"border: 0px; margin: 0px; padding: 0px;\">A</strong>tomicity)</td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">基本可用(<strong style=\"border: 0px; margin: 0px; padding: 0px;\">B</strong>asically&nbsp;<strong style=\"border: 0px; margin: 0px; padding: 0px;\">A</strong>vailable)</td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px; background-color: rgb(246, 244, 240);\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">一致性(<strong style=\"border: 0px; margin: 0px; padding: 0px;\">C</strong>onsistency)</td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">软状态/柔性事务(<strong style=\"border: 0px; margin: 0px; padding: 0px;\">S</strong>oft state)</td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px;\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">隔离性(<strong style=\"border: 0px; margin: 0px; padding: 0px;\">I</strong>solation)</td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">最终一致性 (<strong style=\"border: 0px; margin: 0px; padding: 0px;\">E</strong>ventual consistency)</td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px; background-color: rgb(246, 244, 240);\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">持久性 (<strong style=\"border: 0px; margin: 0px; padding: 0px;\">D</strong>urable)</td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><br/></td></tr></tbody></table><p><br style=\"color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><h2 class=\"tutheader\" style=\"border-width: 1px 0px 0px; border-top-style: solid; border-top-color: rgb(212, 212, 212); margin: 0px; padding: 5px 0px 0px; font-size: 1.8em; line-height: 1.8em; clear: both; color: rgb(51, 51, 51); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, STHeiti, &#39;Microsoft Yahei&#39;, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">NoSQL 数据库分类</h2><table class=\"reference\" width=\"729\"><tbody style=\"border: 0px; margin: 0px; padding: 0px;\"><tr style=\"border: 0px; margin: 0px; padding: 0px; background-color: rgb(246, 244, 240);\" class=\"firstRow\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">类型</td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">部分代表<p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><br/></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">特点</td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px;\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\">列存储</td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Hbase</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Cassandra</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Hypertable</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">顾名思义，是按列存储数据的。最大的特点是方便存储结构化和半结构化数据，方便做数据压缩，对针对某一列或者某几列的查询有非常大的IO优势。</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px; background-color: rgb(246, 244, 240);\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">文档存储</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">MongoDB</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">CouchDB</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">文档存储一般用类似json的格式存储，存储的内容是文档型的。这样也就有有机会对某些字段建立索引，实现关系数据库的某些功能。</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px;\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">key-value存储</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Tokyo&nbsp;Cabinet&nbsp;/&nbsp;Tyrant</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Berkeley&nbsp;DB</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">MemcacheDB</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Redis</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">可以通过key快速查询到其value。一般来说，存储不管value的格式，照单全收。（Redis包含了其他功能）</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px; background-color: rgb(246, 244, 240);\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">图存储</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Neo4J</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">FlockDB</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">图形关系的最佳存储。使用传统关系数据库来解决的话性能低下，而且设计使用不方便。</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px;\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">对象存储</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">db4o</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Versant</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">通过类似面向对象语言的语法操作数据库，通过对象的方式存取数据。</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td></tr><tr style=\"border: 0px; margin: 0px; padding: 0px; background-color: rgb(246, 244, 240);\"><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">xml数据库</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">Berkeley&nbsp;DB&nbsp;XML</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">BaseX</span><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 12pt; font-family: 宋体;\"></span></p></td><td style=\"border-color: rgb(212, 212, 212); margin: 0px; padding: 7px 5px; font-size: 1em; vertical-align: top;\"><p style=\"border: 0px; line-height: 2em; font-family: &#39;Microsoft Yahei&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif;\"><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 14px; font-family: 宋体;\">高效的存储XML数据，并支持XML的内部查询语法，比如XQuery,Xpath。</span></p></td></tr></tbody></table><p><br/></p>', '0', '0', 'display', 'init', '2016-07-19 00:00:00', '2016-07-19 10:54:23');
INSERT INTO `article` VALUES ('4', '8', '1#8', '1', '', '费控宝欢迎您的使用！', '费控宝欢迎页面', '<p>&lt;div class=&quot;partn1&quot;&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;feibi&quot;&gt;费控宝欢迎您的使用！&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;span&gt;7月17日 13:13&lt;/span&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;prating&quot;&gt;费控宝是一款紧跟科技潮流、功能齐全、流程简单、快捷高效的企业级移动应用平台，她摒弃繁琐复杂、消除低效率，她颠覆传统的差旅和费控模式，在为您降本增效、提升您的工作激情的同时，让您不可自拔地爱上工作！</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;pratbut&quot;&gt;接下来，让我们了解一下费控宝的专业化功能吧！&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;/div&gt;&lt;!--partn1--&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;div class=&quot;partn2&quot;&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;travel&quot;&gt;&lt;i&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/xiec.png&quot;&gt;&lt;/i&gt;差旅预订&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;climg&quot;&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/cl.png&quot;&gt;&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p&gt;费控宝对接了携程商旅、滴滴等多种商旅资源，订机票、火车票，订房方便快捷。用费控宝预订差旅，省时省力省钱！&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;/div&gt;&lt;!--partn2--&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;div class=&quot;partn3&quot;&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;travel&quot;&gt;&lt;i class=&quot;te&quot;&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/feiy.png&quot;&gt;&lt;/i&gt;费用报销&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;climg&quot;&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/fybx.png&quot;&gt;&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p&gt;费控宝摒弃一切麻烦的纸质单据，消灭复杂的报销流程。无论平地与山尖，只要您的手机能正常使用，即可让您随时记一笔。费控宝报销流程简单、快捷、高效，颠覆您的想象！&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;/div&gt;&lt;!--partn3--&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;div class=&quot;partn4&quot;&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;travel&quot;&gt;&lt;i&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/kongz.png&quot;&gt;&lt;/i&gt;费用报销&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;climg&quot;&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/fykz.png&quot;&gt;&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p&gt;费控宝不但能让您体验到和专业CFO一样的费控解决服务，同样能为您带来专业化、智能化的资金规划和现金流掌控体验。有了费控宝，费用控制从此轻松搞定！&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;/div&gt;&lt;!--partn4--&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;div class=&quot;partn5&quot;&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;travel&quot;&gt;&lt;i class=&quot;tewid&quot;&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/ydban.png&quot;&gt;&lt;/i&gt;移动办公&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;climg&quot;&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/yd.png&quot;&gt;&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p&gt;费控宝的事务性沟通、工作报告、日程管理、打卡签到等多种移动化OA功能，除了能带给您方便，其他的什么都做不了。&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;/div&gt;&lt;!--partn5--&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;div class=&quot;partn6&quot;&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;travel&quot;&gt;&lt;i class=&quot;te2&quot;&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/dashuj.png&quot;&gt;&lt;/i&gt;移动办公&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p class=&quot;climg&quot;&gt;&lt;img src=&quot;http://7xthno.com1.z0.glb.clouddn.com/dsj.png&quot;&gt;&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">			</span>&lt;p&gt;想了解您企业哪个部门、哪个员工每个月花费最多吗？费控宝告诉你！专业化数据分析与商业智能助您智慧地实现产业转型与升级。&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;/div&gt;&lt;!--partn6--&gt;</p><p><br/></p>', '0', '0', 'display', 'yes', '2016-07-20 00:00:00', '2016-07-20 14:52:19');
INSERT INTO `article` VALUES ('5', '3', '1#3', '1', 'upload/2016/08/30/6140d517aa284700bd3c17ee03ca9208.jpg', '全国最年长老红军逝世 生前享正军职待遇', '最年长老红军黄开群逝世：享年108岁，弹片曾贯穿右', '<p><strong>[提要]</strong>　　据《解放军报》消息，离休干部、河南省军区后勤部原部长（正军职待遇）黄开群同志，因病于2016年7月25日在郑州逝世，享年108岁。1933年，时任红四方面军二纵五旅排长的黄开群与敌人激战时，炮弹弹片从下颚贯穿右眼。因右眼失明，黄开群含泪从前沿转入后方，负责后勤保障。</p><p><!--digest end--></p><table align=\"center\" class=\"tableImg\" cellspacing=\"0\" cellpadding=\"0\"><tbody><tr class=\"firstRow\"><td style=\"text-align: center;\"><img align=\"middle\" class=\"flag_bigP\" alt=\"黄开群（右）和妻子郝书琴\" src=\"/upload/image/20160830/1472559736085054565.jpg\"/><p>2</p></td></tr><tr><td class=\"text-pic-tt\" style=\"text-align: left;\">　　黄开群是安徽六安人，1908年2月出生，1929年8月参加革命，1933年4月加入中国共产党，参加过苏区1至4次反围剿、长征以及百团大战、挺进大别山等战役战斗。历任班长、排长、卫生队长、指导员、科长、供给处处长，河南省军区军械处处长等职。原文配图：黄开群（右）和妻子郝书琴。&nbsp;<a class=\"savePicBtn\" href=\"javascript:void(0);\" desc=\"黄开群是安徽六安人，1908年2月出生，1929年8月参加革命，1933年4月加入中国共产党，参加过苏区1至4次反围剿、长征以及百团大战、挺进大别山等战役战斗。历任班长、排长、卫生队长、指导员、科长、供给处处长，河南省军区军械处处长等职。原文配图：黄开群（右）和妻子郝书琴。\" picurl=\"http://photocdn.sohu.com/20160830/Img466706002.jpg\">[保存到相册]</a></td></tr></tbody></table><p>　　全国最年长的老红军、开国大校黄开群逝世。</p><p></p>', '0', '0', 'display', 'init', '2016-08-30 00:00:00', '2016-08-30 20:22:25');
