INSERT INTO `article` VALUES ('9', '1', '1', '1', '', '升级', '', '<p>&lt;!doctype html&gt;</p><p>&lt;html&gt;</p><p>&lt;head&gt;</p><p>&lt;meta charset=&quot;utf-8&quot;&gt;</p><p>&lt;meta content=&quot;width=device-width,minimum-scale=1.0,maximum-scale=1.0,user-scalable=no&quot; name=&quot;viewport&quot; /&gt;</p><p>&lt;title&gt;无标题文档&lt;/title&gt;</p><p>&lt;style&gt;</p><p>*{ font-family:&quot;微软雅黑&quot;;font-size:14px}</p><p>&lt;/style&gt;</p><p>&lt;/head&gt;</p><p><br/></p><p>&lt;body&gt;</p><p>&lt;div&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;费控宝V1.3.1更新&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;转眼又是一年年底，又到了突击花钱的季节，费控宝的更新为您的企业解决年底的烦忧。&lt;/p&gt;</p><p>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;本次更新内容：&lt;/p&gt;</p><p>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;1、全局搜索，方便您快速检索到自己想要的信息，快人一步才，能先声夺人。&lt;/p&gt;</p><p>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;2、事务性沟通，让沟通更顺畅，更及时。&lt;/p&gt;</p><p>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;3、界面优化，追求高效的同时更强调界面的精美。&lt;/p&gt;</p><p>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;4、性能的提升，让您在无形之中体验操作的顺畅。&lt;/p&gt;</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;&lt;a href=&quot;http://feikongbao.com/download/&quot;&gt;点击升级&lt;/a&gt;&lt;/p&gt;</p><p>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>&lt;p&gt;从此告别低效。&lt;/p&gt;</p><p>&lt;/div&gt;</p><p>&lt;/body&gt;</p><p>&lt;/html&gt;</p><p><br/></p>', '0', '0', 'display', 'yes', '2016-11-15 00:00:00', '2016-11-15 19:12:55');
INSERT INTO `article` VALUES ('11', '1', '1', '1', 'upload/2016/11/17/56dd179018614a27a5e5a961b4686a4e.jpg', '重要通知：版本升级提醒', '由于您的APP版本过低，存在很大风险，请您于2016年12月4日0点前升级至最新版本，否则出于对您的数据安全考虑，我们将限制您的登录以及后续操作。', '<p style=\"text-align: left; line-height: 10px;\"><br/></p><p style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0); font-size: 20px;\">重要通知：费控宝版本升级</span></p><p style=\"text-align: left;\"><span style=\"color: rgb(100, 100, 100); font-family: 黑体, SimHei; font-size: 18px;\">2016-11-28</span></p><p style=\"text-align: left; line-height: 6px;\"><br/></p><hr size=\"2\" style=\"width: 100%; color: rgb(191, 191, 191);\"/><p><br/></p><p><img width=\"100%\" src=\"http://www.uedcss.com/i/pic/fkb.png\"/><br/></p><p><br/></p><p>&nbsp; &nbsp; 由于您的APP版本过低，存在很大风险，请您于2016年12月4日0点前升级至最新版本，否则出于对您的数据安全考虑，我们将限制您的登录以及后续操作。<br/></p><p><br/></p><p><a href=\"http://t.cn/Rffvaxj\" target=\"_self\"><span style=\"text-decoration: underline;\"><strong>点击升级版本</strong></span></a></p><p><br/></p>', '0', '0', 'display', 'yes', '2016-11-28 00:00:00', '2016-11-17 20:17:08');
